import Evento from "./Evento";

const Eventos = props => {
  const { eventos } = props.eventos;
  return(
    <div>
      {eventos.map(evento => (
        <Evento key={evento.venue_id} evento={evento} />
      ))}
    </div>
  );
};
export default Eventos;
